import WorkoutForm from "../workoutform";
const Homepage = () => {
  return (
    <div>
      <h4>Welcome to your Homepage</h4>
      <div className="hero"></div>
      <br></br>
      <WorkoutForm />
    </div>
  );
};
export default Homepage;
